import { AppBar, Fab } from '@mui/material'
import React from 'react'
import { Container } from 'react-bootstrap'

const MyDetails = () => {
    return (
        <Container>
            <Fab sx={{width:"100%"}} variant="extended">
                Navigate
            </Fab>
        </Container>
    )
}

export default MyDetails
